import React from "react";

export const FlowerIntro = () => {
  return (
    <main>
      <section className="intro">
        <h2>
          Choose the bouquet what will be asking on your taste and specify
          situation
        </h2>
        <div>
          Birthday, Anniversary, or simple gift - we can do everything possible
          and imposible to create with help of only flower
        </div>
      </section>
    </main>
  );
};
